import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, TextInput } from 'react-native';

export default function HealthCalculatorScreen({ route, navigation }) {
  return (
    <View style={styles.container}>
      <View style={{
        width: '100%',
        padding: 10,
      }}>
        <Text>Height(kg.)</Text>
        <TextInput
          style={styles.coursenameinput}
          onChangeText={setCourseName}
          value={courseName}
        />
        <Text>Weight(cm.)</Text>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: "center",
    padding: 30,
    width: '100%'
  },
  coursenameinput: {
    height: 40,
    width: "100%",
    borderWidth: 0.5,
    borderColor: "lightgray",
    borderRadius: 3,
    padding: 10,
    marginTop: 10
  },
});
